import "./ExpenseItem.css";
export const ExpenseItem = (props: any) => {
  const expenseDate: Date = new Date(2022, 2, 8);
  const expenseTitle: string = "Car Insurance";
  const expensePrice: number = 296.46;
  console.log(`The data received is: ${props}`);

  return (
    <div className="expense-item">
      <div className="">{props.date.toISOString()}</div>
      <div>
        <div className="expense-item__description">
          <h2>{props.title}</h2>
        </div>
        <div className="expense-item__price">${props.amount}</div>
      </div>
    </div>
  );
};
